#include <iostream>

using namespace std;

int main()
{
    char listchar[1001] = "";
    int listnum[1001];
    for (int i = 0; i < 1000; i++)  {
        listnum[i] = listchar[i] - 48;
    }
    int highest = 0, now;
    for (int i = 0; i < (1000 - 5); i++)    {
        now = listnum[i];
        for(int x = 1; x < 5; x++)  {
            now *= listnum[i+x];
        }
        if (now > highest)  {
            highest = now;
        }
    }
    cout << highest;
    return 0;
}
